import * as celo from './celoLib'

//Login button configuration: Only Metamask at the moment.
document.querySelector('#sign-in-button').onclick = celo.login;

//Initializing contracts and calling instructions in signedInFlow
window.celoInitPromise = celo.initContractCelo().then(() => { signedInFlow() }).catch(console.error);
//window.mapInit = satmap.init();

//Everything that needs to be executed once the wallet is connected to smart contracts
async function signedInFlow() {
  let isConnected = await celo.metamaskIsSignedIn();  //Ask if the user is connected
  if (isConnected) {
    document.getElementById('sign-in-button').innerHTML = "Connected";
    document.getElementById('sign-in-button').disabled = true;
//    console.log(window.accountIdcelo);  //Show users address
    const result = await celo.checkEKOXBalance(window.accountIdcelo);
    window.costListOwned = await celo.getCostList(window.accountIdcelo);
    window.coordinatesListOwned = [];

    for (let j = 0; j < window.costListOwned.length; j++) {
      const coord = await celo.getCoordinates( window.accountIdcelo, j );
      window.coordinatesListOwned.push( coord );
    }

    console.log(window.costListOwned);
    //this is hard coded, sorry.
    let balance = ( result / 10**18 ).toFixed(4);
    document.getElementById('balance_label').innerHTML = 'EKOX Balance: ' + balance;

    let hasInitialized = await celo.isFirstTime(window.accountIdcelo);
    console.log(hasInitialized);
    if (hasInitialized==false){
      document.getElementById('start-claim').style.display  = "block";
    } else {
      document.getElementById('start-claim').style.display  = "none";
    }

  } else {
    document.getElementById('sign-in-button').innerHTML = "Connect";
    document.getElementById('sign-in-button').disabled = false;
  }

}   

document.getElementById('claim-start').onclick = async function () {
  let result = await celo.claimStartingTokens();
  window.location.replace(window.location.origin + window.location.pathname);
};

document.getElementById('claim-purchase').onclick = async function () {
  let result = await celo.buyLand( window.coordinateList, window.costPurchase );
  document.getElementById('purchase-panel').style.display = 'none';
  window.location.replace(window.location.origin + window.location.pathname);
};

document.getElementById('check-yield-claim').onclick = async function () {
  let timeList = await celo.getTimeList( window.accountIdcelo );
  console.log(timeList);
  let priceList = await celo.getCostList( window.accountIdcelo );
  let amount = 0;
  const d = new Date();
  let actualTime = d.getTime() / 1000;  
  for(let i=0;i<timeList.length;i++){
    amount += ( actualTime - timeList[i] ) * ( window.yieldListAll[i] + priceList[i] ) / 2.0;
  }
//  console.log(amount);
  amount = amount / 10 ** 6;
  document.getElementById('check-yield-panel').style.display = 'none';
  document.getElementById('claim-yield-panel').style.display = 'block';  
  document.getElementById('claimYield').innerHTML = "Yield to claim: " + amount.toFixed(6) + " EKOX";
  window.amountToClaim = amount;
};

document.getElementById('claim-yield').onclick = async function () {
  let result = await celo.claimYield( window.amountToClaim );
  document.getElementById('claim-yield-panel').style.display = 'none';
  window.location.replace(window.location.origin + window.location.pathname);
}
